اس کا بطور آبجیکٹ تعین کیا جاتا ہے۔ یہ ایک اسپارس ایرے ہے جس میں ہر پراپرٹی حرف کا سیٹ کوڈ ہے اور قدر ایک ایسا آبجیکٹ ہے جو بذات خود ایک اسپارس ایرے ہے۔ اس اسپارس ایرے میں، ہر پراپرٹی وصول کردہ حرف ہے اور قدر ڈسپلے کردہ حرف ہے۔

مثال کے طور پر:
{ "0": {
  "+": "\u2192",
  ",": "\u2190",
  "-": "\u2191",
  ".": "\u2193",
  "0": "\u2588"
} }
